SELECT DISTINCT ?country ?populationTotal WHERE {
  ?country a <http://dbpedia.org/ontology/Country> .
  ?country <http://dbpedia.org/ontology/populationTotal> ?populationTotal .
  FILTER NOT EXISTS {
    ?country a <http://dbpedia.org/ontology/Organisation> .
  }
  FILTER NOT (
    regex(str(?country), "Organisation", "i") ||
    regex(str(?country), "Union", "i") ||
    regex(str(?country), "Association", "i") ||
    regex(str(?country), "Commonwealth", "i") ||
    regex(str(?country), "BBIN", "i")
  )
}
ORDER BY DESC(?populationTotal)
LIMIT 10

